window.bookSummaryJSON = "<p>Everything I've done, everything I will do...there will be no regret. The world is a vicious place for a woman. It's even crueler to the daughter of the Ceann na Conairte - discarded, married off, left powerless...But I am no ordinary daughter of the mafia.</p> <p>Unlike every other mafia family, my mother was Melody Callahan, Bloody Mel, the Don of the Italian Mafia, and the Don didn't raise some precious mafia princess. Bone by bone she broke me first, so no one else could - and bone by bone, I pieced myself back together. </p> <p>I am no longer just the daughter. I am the Don. I am Donatella Aviela Callahan, and there is only one way - my way.</p> <p><i>Contains mature themes.</i></p>"; 
